window.bookSummaryJSON = "<p>Marcus Hamilton Thanos is marked for death, and Jack Noble is the man for the job. But when the high-profile target vanishes the day of the assassination attempt, Jack is forced to team up with a female FBI agent who was poised to learn Thanos' secret that morning. </p> <p>Together, they are plunged into a frantic race across state lines and international borders in order to solve the mystery, all the while unsure of who they can trust. What they discover is that the truth is more chilling and deceptive than either of them could have imagined.</p>"; 
